import { Component, ViewEncapsulation ,Input} from '@angular/core';


@Component({
  selector: 'app-card',
  templateUrl:'./card.component.html' ,
  styleUrls: ['./card.component.css']
})
export class CardComponent {
  @Input() finaldata: string;
  constructor() {
    this.finaldata=""
  }
}
